export default function SeqRange () {


    function handleFocus(event) {
        event.target.style.border = 'none'
        event.target.style.outline = 'none'
    }

    return (
        <form autoComplete='off'>
            <div style={{height: height, width: 200, backgroundColor: 'white', borderRadius: radius, marginLeft: 20, display: 'flex', flexDirection: 'row', position: 'relative', zIndex: 3 }}>
                {/* <img src={searchIcon} style={{ height: height+offset, marginTop: -offset/2, borderRadius: radius }} alt='search icon'/> */}
                <input id='range-begin' type='text' placeholder='1' style={{ height: height-2, width: 100, backgroundColor: 'white', borderRadius: radius, border: 'none' }} onFocus={(event) => handleFocus(event)}></input>
                <input id='range-begin' type='text' placeholder='1000' style={{ height: height-2, width: 100, backgroundColor: 'white', borderRadius: radius, border: 'none' }} onFocus={(event) => handleFocus(event)}></input>
            </div>
        </form>
    )
}
